import React from 'react';
import styled from 'styled-components';
import backImage from '../../Images/menueBack/menueBack.jpg';
const MenueDiv = styled.img`
position  : absolute;
top       : 0;
left      : 0;
width     : 100vw;
height    : 100vh;
object-fit: cover;

&::before{

  content   : '';
  position  : absolute;
  z-index   : 2;
  width     : 100%;
  height    : 100vh;
  bottom    : 0vh;
  left      : 0;
  overflow  : hidden;
  opacity   : 0.4;
  background: linear-gradient(
    0deg,
    rgba(0,0,0,0.2)0%,
    rgba(0,0,0,0.2)50%,
    rgba(0,0,0,0.6)100%,
  );
}
`;

const MainDiv=styled.div`
position      : relative;
z-index       : 10;
display       : flex;
flex-direction: column;
max-width     : 1600px;
color         : #fff;


h1{
  font-size     : clamp(1rem,8vw,2rem);
  font-weight   : 400;
  text-transform: uppercase;
  text-shadow   : 0px 0px 20px rgba(0,0,0,0.4);
  text-align    : left;
  margin-bottom : 0.8rem;
}
p{
  text-shadow  : 0px 0px 20px rgba(0,0,0,0.4);
  margin-bottom: 1.2rem;
}
`;
const MenueOfShop = () => {
    return (
        <MainDiv src={backImage} alt='../klkl'>
          
             <MenueDiv >
             <h1>
           The Menue
       </h1>
       </MenueDiv>
      
        </MainDiv>
      
    )
}

export default MenueOfShop
